・ヴァレンティのジュエルLEDハイマウントストップランプ、TY1701-C7L-1です。
<BR>・上下２段、合計１７個のLEDを採用。圧倒的な存在感と、逆台形のランプ配列でクールなイメージを演出。さらに、スモールランプとしての点灯も可能。<B>ヴァレンティLEDテールランプ</B>と合わせたトータルコーディネート。配線不要、カプラーオンで純正交換可能です。
<BR>・クリアなイメージを前面に押し出すクローム。LEDの輝きが最も映えるシャープな印象。シルバーリムタイプ。
<BR>・200系ハイエース/レジアスエース(H16.8～H24.4)に適合します。安心の一年保証、保安基準適合（車検対応）品です。
<BR><FONT SIZE=2>
<BR>※スモールランプ機能使用時は保安基準に適応しません。

